import React, {Component} from "react"
import {BrowserRouter as Router, Route, Switch} from "react-router-dom"
import Header from "./Header.jsx"
import Footer from "./Footer.jsx"
import LoginPartOne from "./LoginPartOne"
import LoginPartTwo from "./LoginPartTwo"
import Error from "./Error"
import HomePage from "./HomePage.jsx"
import registration from "./registration.jsx"
import MatchSearchList from "./MatchSearchList.jsx"

class MyApp extends Component {
    render(){

        return(
           
            <div className="MyApp">

                <Router>
                    <>

                        <Header/>

                        <Switch>
                            <Route path="/list/" component={MatchSearchList}/>  
                            <Route path="/registration/" component={registration}/>
                            <Route path="/login-part-one/" component={LoginPartOne}/>
                            <Route path="/login-part-two/" component={LoginPartTwo}/>
                            <Route path="/welcome/" component={Welcome}/>
                            <Route path="/" component={HomePage}/>
                            <Route component={Error}/>
                        </Switch>

                    </>

                        {/* <Footer/> */}

                </Router>

                </div>
        )
    }
}


class Welcome extends Component {
    render(){
        return(
            <div>
                  Welcome Component {this.props.match.params.phonenumber} 
                  <MatchSearchList/>
            </div>
        )
    }
}

